import { useRoutes } from 'react-router-dom';
import WebsiteMenu from './WebsiteMenu.jsx'
import FunctionalComponentInReact from './Component/FunctionComponent/01';
const WebsiteCompoMenu = () => {

    const routes = useRoutes([
        {
            path: "/",
            element: <WebsiteMenu />,
            children: [
                {
                    path: "whatisfunctionalcomponent",
                    element: <FunctionalComponentInReact />,
                },
            ]
        }])
    return routes;
}

export default WebsiteCompoMenu;
